INSERT INTO `blog_posts` VALUES (1582,'Bitcoins and Gravy EP #74: BitLunch & Bitcoin Music 2015','bitcoins-and-gravy-ep-74-bitlunch-bitcoin-music-2015-1','On today\'s show I head over to Tenn 16, one of East Nashville\'s great little eateries where I meet up with Melvin, Aaron, Kate and Bob of the New Nashville BitLunch meetup group. During lunch we talk about the youth unemployment crisis here and abroad, the miserable failure of a Vancouver bitcoin ATM machine, the prestigious Vanderbilt University Computer Science Department and everything else bitcoin related. The BitLunch meetup group is a revolving group of great folks who enjoy getting together once a week at a local restaurant to eat lunch, share stories and talk each others ears off about bitcoin, bitcoin and more bitcoin! \r\n\r\nAlso on this episode We review the Bitcoin Music of 2015 Featuring some of the greatest musical compositions ever written in the history of the world - the Bitcoin world that is. \r\n\r\nAnd remember to check out my Holiday Bitcoin Song - Let It Grow. You can find it here:\r\n\r\nhttps://letstalkbitcoin.com/blog/post/holiday-bitcoin-song-let-it-grow\r\n\r\n\r\nThanks to our sponsor Moonshine Cowboy Boot Wax, the Original, All Natural, non-toxic boot wax with a scent of orange. \r\n\r\n[www.MoonshineBootWax.com](http://www.MoonshineBootWax.com)\r\n\r\nTo order any of these fine all-natural products, just head over to [MoonshineBootwax.com](http://www.MoonshineBootWax.com). Use your credit card, your debit card or better yet... pay with Bitcoin!\r\n\r\nIf anyone out there feels filled with the Christmas Spirit of giving, please scroll down to find my bitcoin address at the very bottom of the show notes and send me a small tip.\r\n \r\nIf you\'ve never done this before, it\'s actually easier to do than you might think and its also a fun experience. Heres how: First, just copy the bitcoin address found at the bottom of the show notes. Next, go to [www.Blockchain.info](www.Blockchain.info) and paste the Bitcoin address there. You\'ll immediately see public information about my wallet as well as the QR code for my wallet. This QR code and the associated number here in the show notes is called my Public Key.\r\n\r\nThen just use the bitcoin wallet you have installed on your smartphone.  Scan my QR code and send a small tip my way. And listen, if you think a $1.00 tip is too small, then think again.  A dollar in bitcoins, sent to me from ten listeners out there will buy me lunch.  And that\'s not all, it also makes me feel that there actually IS someone out there who is listening to the show and appreciating the hard work that I put into the show each week. So if you\'ve enjoyed the music and if you\'ve enjoyed the show this week, please send a small bitcoin tip my way. Even 25 cents in bitcoin will put a smile on my face and coffee in the kettle.  I\'m a hard working guy with two jobs, so your help is much appreciated. \r\n\r\n\r\n##MAGIC WORD:\r\n\r\nHidden in each episode of Bitcoins and Gravy is a Magic Word. I know that it may sound absurd, but listen for the Magic Word and you can earn LTBcoin! First set up a free account at [LetsTalkBitcoin.com](http://LetsTalkBitcoin.com). Then tune in to your favorite LTB podcast and when you hear the Magic Word, don\'t delay! Submit it to your account to claim a share of this weeks distribution of LTBcoin. Listeners now have a full week from the release date to claim a magic word. \r\nSetting up an LTB account has always been fast and easy... and now its profitable!!! \r\n\r\n##CREDITS & VALUABLE LINKS:\r\n\r\n**email:**  malcomtheminer@gmail.com  \r\n**website:** http://malcomtheminer.com\r\n\r\nhttp://www.pinterest.com/malcomtheminer/  \r\nhttp://www.facebook.com/malcomtheminer  \r\nhttp://www.twitter.com/malcomtheminer\r\n\r\nhttp://www.MoonshineBootWax.com\r\n\r\n**Ode to Satoshi **\r\n\r\nLyrics and Music by John Barrett  \r\n2015, RJM Publishing [BMI]\r\n\r\n\r\nLead Vocal, Harmony Vocals, Harmonica, Snare Drum: John Barrett  \r\nHarmony vocals: John Barrett, Connie Sinclair and Lij Shaw  \r\nGuitar: Jonathan Brown  \r\nMandolin: Ben Miller  \r\nBass Guitar: Michael Rinne\r\n\r\nInitial tracks recorded by Mark Thornton of Sidekick Sound Studios, Madison, TN.  All other tracks Recorded, Mixed and Mastered at The Toy Box Studio, Nashville, Tennessee  \r\nEngineer: Lij Shaw. Assistant to engineer: Don \"The Don\" Bates  \r\nProduced by John Barrett & Elijah \"Lij\" Shaw\r\n\r\n************\r\n\r\n**Lowdown Bitcoin Blues**  \r\nLyrics and Music by John Barrett  \r\n2015, RJM Publishing [BMI]\r\n\r\n\r\nWasted all my time back in 09 I should have been mining blocks  \r\nNow all Ive gots a Dogecoin rig and holes in my Alpaca socks\r\n\r\nI got them low down Bitcoin Blues Im cryin   \r\nHear the low down Bitcoin news I aint lying to you  \r\nLow down Bitcoin Blues Im dyin honey   \r\nLow down Bitcoin Blues\r\n\r\nBTC convention came to my hometown at last  \r\nI had to sell my only bitcoin just to buy a 2 day pass  \r\n\r\nI got them low down Bitcoin Blues Im cryin   \r\nHear the low down Bitcoin news I aint lying to you  \r\nLow down Bitcoin Blues Im dyin honey   \r\nLow down Bitcoin Blues\r\n\r\nTook a trip to China . . . town for Beef chow mein to go    \r\nFortune cookie told me \"We no taking bitcoin anymore\"  \r\n\r\nI got them low down Bitcoin Blues I\'m cryin   \r\nHear the low down Bitcoin news I aint lying to you   \r\nLow down Bitcoin Blues Im dyin honey   \r\nLow down Bitcoin Blues  \r\n\r\nWent up town to see my CPA for some advice  \r\nHe told me death and taxes son and then just roll Satoshi Dice.  \r\n\r\nI got them low down Bitcoin Blues I\'m cryin  \r\nHear the low down Bitcoin news I aint lying to you  \r\nLow down Bitcoin Blues Im dyin honey   \r\nLow down Bitcoin Blues  \r\n\r\n************\r\n\r\n**The Bitcoin Trader**  \r\nLyrics and Music by John Barrett  \r\n2015, RJM Publishing [BMI]\r\n\r\nIm The Bitcoin Trader Navigator of the Bitcoin sea  \r\nIm a real motivator bout a makin lotta money for me  \r\nAnd I might go short or long but I like  \r\nTo tell everybody that Ive never been wrong  \r\nIm The Bitcoin Trader come on and hear me sing my song\r\n\r\nWell I made about a quarter million dollars on the old Mt. Gox  \r\nThen I jumped that ship about a year before it hit the rocks  \r\nI put a little into LTC and when it tripled man I bought a place in Waikiki  \r\nIm The Bitoin Trader come on and take a look at me\r\n\r\n*GUITAR SOLO*\r\n\r\nWell I dont use bots but I know a lot of other people do  \r\nI got a built in barometer, back up tachometer too  \r\nAnd I know just when to sell   \r\nWhen were off To The Moon like a bat outa hell  \r\nI\'m The Bitcoin Trader come on and hear me ring my bell  \r\n\"Full speed ahead captain!\"  \r\nWell ride them Bitcoin waves boys, ride em high and low  \r\nI said ride them Bitcoin waves Heave Ho, Heave Ho  \r\nI don\'t give a damn about no whales  \r\nThose Moby Dicks are gonna burn in Hell  \r\nSo ride them Bitcoin waves a way Heave Ho!  \r\n\r\n\"Here we go and I say:\"  \r\n\r\nRide them Bitcoin waves boys, ride em high and low  \r\nRide them Bitcoin waves Heave Ho, Heave Ho  \r\nI aint scared of no shark attack Yo Ho!  \r\nI just pray to God Almighty that I dont get hacked  \r\nPray to God Almighty that I dont get hacked  \r\n\r\nPray to God Almighty that I dont get hacked today  \r\nPray to Mighty God Almighty that I dont get hacked today  \r\n\r\nWell pigs in the pen, gunnies in the sack  \r\nCorns in the crib and the hays all stacked  \r\nGet a little bitcoin never look back   \r\nPray to God Almighty that I dont get hacked  \r\nPray to Mighty God Almighty that I dont get hacked.  \r\n\r\n************\r\n\r\n**Crypto (The Official Cryptocurrency Song)**  \r\nLyrics and Music by John Barrett  \r\n2015, RJM Publishing [BMI]  \r\n\r\nInstrumental arrangement by John Barrett and Jamie Sparks  \r\nAll instrumentals played by Jamie Sparks\r\n\r\n\r\nLook at the Cryptocurrency, man its sucha blur and see  \r\nA new one every day  \r\nThey got the pump and dump   \r\nTheyll try to make you a chump  \r\nYou better watch your back I say  \r\nI hear the troll box singing till my ears are ringin \r\nIm afraid just to go to bed   \r\nAnd Im not feeling so well  \r\nTell me should I buy or sell\r\n\r\nWe got the Androids tokin   \r\nAnd the Dopecoin smokin  \r\nIts a thing mamma you should see  \r\nWe got the Potcoin, man its such a hot coin  \r\nAll the way from Denver to DC  \r\nWe got the Hashcoin, now we need a Stash coin  \r\nOr well lose it all and thats a drag  \r\nAnd I say blockchain schmockchain  \r\nId just like to get a bag  \r\n\r\n\r\nI think Im gonna fly to Denver  \r\nI think Im gonna get real high up on a bender  \r\nMaybe find a heart thats tender  \r\nHelp me to lay down and night  \r\n	\r\n\r\nYou know it\'s Soho strange when another exchange is  \r\nCreepin in like another bad sin  \r\nIt\'s a legitimate fear that they will disappear  \r\nAnd you will never see your money again  \r\nYou tell me its the right coin but its just a Litecoin  \r\nMaybe Ill have tea with Charlie Lee  \r\nOh baby and it\'s blowin my mind  \r\nCause I don\'t know which one to buy  \r\n\r\nBlowin my mind  \r\nI dont know which one to buy\r\n\r\nBlowing my mind  \r\nI dont know which one to buy\r\n\r\nGood Lord I got my feet on the ground  \r\nBut man my head is spinning round\r\n\r\nAnd all the world is Crypto oh oh oh oh  \r\n\r\n\r\n*******************\r\n\r\nSpecial thanks to Alan Baird for his dobro, guitar and mandolin playing on many of the shows. Now that\'s some pickin man! Thanks also to Alex Munoz Guijarro for his excellent pedal steel playing on many of our shows.\r\n\r\nInterviews for this episode were recorded and edited by John Barrett at The Tree House Studio - Nashville, Tennessee. All shows are produced by John Barrett with the moral support of his trusty sidekick Maxwell Rascalnikov CoyoTe Rex, aka Max.\r\n\r\nTheme song \"Gravy\" by the band, Eleanor Roosevelt with Elijah \"Lij\" Shaw on fiddle.\r\n \r\n##Questions or Comments?\r\n\r\n**Email me to say Howdy!:** [howdy@bitcoinsandgravy.com](mailto:howdy@bitcoinsandgravy.com)\r\n\r\n**Visit my website:** http://BitcoinsAndGravy.com\r\n\r\n**Bitcoins and Gravy Tipping Addresses:**\r\n\r\nBitcoin: 14RbXduu2sXKNHtKtRVAx8xQyGAubjY1dA  \r\nLitecoin: LgqYgxLTBPgr8C1JGLLJVLK4ZN1fveprAp\r\n',79,1,'2016-01-03 17:08:02','2016-01-03 17:06:00',1,NULL,'On today\'s show I head over to Tenn 16, one of East Nashville\'s great little eateries where I meet up with Melvin, Aaron, Kate and Bob of the New Nashville BitLunch meetup group. During lunch we talk about the youth unemployment crisis here and abroad, the miserable failure of a Vancouver bitcoin ATM machine, the prestigious Vanderbilt University Computer Science Department and everything else bitcoin related. The BitLunch meetup group is a revolving group of great folks who enjoy getting togeth...',1,1,'1582-664e09abdb1f91d64cefd6323425dc2b003e392d0cab8c6c2825077847d7e68f.jpg',0,0,'2016-01-03 17:08:02','markdown','2016-01-03 17:09:11',79,'published','',0,3756);
