INSERT INTO `content_blocks` VALUES (1,'Footer info','footer-info',' Copyright 20132015 The LTB Network. All rights reserved [<i class=\"fa fa-github-alt\"></i>](https://github.com/tokenly/tokenly-cms).  \r\nWebsite development by [IronClad Web Technologies](mailto:sales@ironcladtech.ca).\r\n\r\n',1,1,'markdown'),(5,'Homepage Sidebar','home-sidebar','',1,1,'wysiwyg'),(6,'Header Social Media','header-social','',1,1,'raw'),(7,'Markdown Guide','markdown-guide','<p><strong>Alternate Guides:</strong><br /> <a href=\"https://www.loomio.org/d/Wh7vHaTk/markdown-text-formatting-made-easy\" target=\"_blank\">Loomio</a><br /> <a href=\"https://guides.github.com/features/mastering-markdown/\" target=\"_blank\">Github</a></p>\r\n<h4>Emphasis:</h4>\r\n<blockquote><strong><em>Italic:</em></strong> *emphasize single asterisks* _emphasize single underscores_<br /> <strong>Bold:</strong> **Strong double asterisks** __Strong double underscores__</blockquote>\r\n<p>will produce:</p>\r\n<p><em>emphasize single asterisks</em><br /> <em>emphasize single underscores</em><br /> <strong>Strong double asterisks</strong><br /> <strong>Strong double underscores</strong></p>\r\n<h4>Inline Links:</h4>\r\n<blockquote>A [link](http://www.letstalkbitcoin.com).</blockquote>\r\n<p>Will produce:</p>\r\n<p>A <a href=\"http://www.letstalkbitcoin.com\">link</a></p>\r\n<h4>Referenced Links:</h4>\r\n<blockquote>Some text with [a link][1] and another [link][2].<br /> [1]: http://www.letstalkbitcoin.com/ \"Title1\"<br /> [2]: http://www.google.com/ \"Title2\"</blockquote>\r\n<p>The reference section can be anywhere in the document</p>\r\n<p>Will produce:</p>\r\n<p>Some test with <a href=\"http://www.letstalkbitcoin.com\" title=\"title1\">a link</a> and another <a href=\"http://www.google.com\" title=\"title2\">link</a></p>\r\n<h4>Inline Images:</h4>\r\n<blockquote>Logo: ![Alt](/ltb.png \"Title\")</blockquote>\r\n<p>The \"Alt\" text (alternative text) makes images accessible to visually impaired</p>\r\n<h4>Referenced Images:</h4>\r\n<blockquote>Smaller logo: ![Alt][1]<br /> [1]: /ltb-smaller.png \"Title\"</blockquote>\r\n<p>Inline and referenced images will produce:</p>\r\n<p>Logo: <img src=\"../../../themes/ltb/images/logo.png\" border=\"0\" alt=\"Title\" /></p>\r\n<h4>Linked Images:</h4>\r\n<blockquote>Linked logo: [![alt text](/ltb-smaller.png)](http://letstalkbitcoin.com/)</blockquote>\r\n<p>Linked images will produce:</p>\r\n<p>Linked logo: <a href=\"../../../\" title=\"Title\"><img src=\"../../../themes/ltb/images/logo.png\" border=\"0\" /></a></p>\r\n<h4>Footnotes:</h4>\r\n<blockquote>[^1]: To say down here.</blockquote>\r\n<p>Footnotes will be added to the bottom of the document, with a link back to the original reference</p>\r\n<p>Will produce:</p>\r\n<p><sup><a href=\"#fn1\">1</a></sup>To say down here.<br /> <sup id=\"fn1\">1. [Text of footnote 1]<a href=\"#ref1\" title=\"Jump back to footnote 1 in the text.\">Back</a></sup></p>\r\n<h4>Line Breaks</h4>\r\n<blockquote>\r\n<pre>To make text go down just one line instead of paragraph, add 2 spaces at the end of the line before your  \r\nline break\r\n</pre>\r\n</blockquote>\r\n<h4>Horitzontal Rules:</h4>\r\n<blockquote>* * * *<br /> ****<br /> --------------------------</blockquote>\r\n<p>All of the above will produce a horizontal rule:</p>\r\n<hr />\r\n<h4>Bullet Lists:</h4>\r\n<blockquote>* Item<br /> * Item<br /> - Item<br /> - Item</blockquote>\r\n<p>Will produce:</p>\r\n<ul>\r\n<li>Item</li>\r\n<li>Item</li>\r\n<li>Item</li>\r\n<li>Item</li>\r\n</ul>\r\n<h4>Numbered Lists:</h4>\r\n<blockquote>1. Item<br /> 2. Item</blockquote>\r\n<p>Will produce:</p>\r\n<ol>\r\n<li>Item</li>\r\n<li>Item</li>\r\n</ol>Mixed Lists:\r\n<blockquote>\r\n<pre>1. Item\r\n2. Item\r\n   * Mixed\r\n   * Mixed  \r\n3. Item\r\n	</pre>\r\n</blockquote>\r\n<p>Will produce:</p>\r\n<ol>\r\n<li>Item</li>\r\n<li>Item\r\n<ul>\r\n<li>Mixed</li>\r\n<li>Mixed</li>\r\n</ul>\r\n</li>\r\n<li>Item</li>\r\n</ol>\r\n<h4>Blockquotes:</h4>\r\n<blockquote>&gt; Quoted text.<br /> &gt; &gt; Quoted quote.<br /> &gt; <br /> &gt; * Quoted <br /> &gt; * List</blockquote>\r\n<p>The above example will produce:</p>\r\n<blockquote>Quoted text.\r\n<blockquote>Quoted quote.</blockquote>\r\n<ol>\r\n<li>Quoted</li>\r\n<li>List</li>\r\n</ol></blockquote>\r\n<h4>Preformatted:</h4>\r\n<blockquote>\r\n<pre> Begin each line with \r\n  two spaces or more to \r\n  make text look\r\n  e x a c t l y \r\n  like  you  type i\r\n  t.\r\n  </pre>\r\n</blockquote>\r\n<h4>Code:</h4>\r\n<blockquote>`This is example code`</blockquote>\r\n<h4>Code Block:</h4>\r\n<blockquote>\r\n<pre>~~~~\r\nThis is a \r\npiece of example\r\nin a block\r\n\r\nif(foo == bar){\r\n	echo \'hello\'\r\n}\r\n~~~~\r\n\r\n```\r\nThis too\r\n```\r\n	</pre>\r\n</blockquote>\r\n<p>All of the above example will produce:</p>\r\n<code> This is a piece of example code in a block</code>\r\n<p>P.S. if you need your code to be indented, the HTML result will be:</p>\r\n<pre><code>This is a\r\n	piece of example code\r\n				in a block</code></pre>\r\n<h4>Headers:</h4>\r\n<blockquote># Header 1<br /> ## Header 2<br /> ### Header 3 <br /> #### Header 4 ####<br /> ##### Header 5 #####<br /> ###### Header 6 ######</blockquote>\r\n<p>Closing hash marks are optional on all levels. All of the above can be translated into:</p>\r\n<h1>Header 1</h1>\r\n<h2>Header 2</h2>\r\n<h3>Header 3</h3>\r\n<h4>Header 4</h4>\r\n<h5>Header 5</h5>\r\n<h6>Header 6</h6>\r\n<br />\r\n<h4>Abbreviations:</h4>\r\n<blockquote>*[HTML]: HyperText Markup Language</blockquote>\r\n<p>Will produce:</p>\r\n<p><abbr title=\"HyperText Markup Language\">HTML</abbr></p>\r\n<p>Definitions can be anywhere in the document</p>\r\n<p>For more information about markdown: <a href=\"http://en.wikipedia.org/wiki/Markdown\" target=\"_blank\">http://en.wikipedia.org/wiki/Markdown</a></p>',1,1,'wysiwyg'),(8,'RSS Page Content','rss-content','<h1>RSS Feeds</h1>\r\n<p><strong>Available Feeds</strong></p>\r\n<ul class=\"disc\">\r\n<li><a href=\"rss/feed/blog\" target=\"_blank\">Blog Post Feed</a></li>\r\n</ul>\r\n<h3>Create Custom Feed</h3>\r\n<p>Use the form below to generate a customized RSS feed link.</p>',1,1,'wysiwyg'),(20,'Dashboard Blog Submission Form','dashboard-blog-submission-form','Post formatting can be done via either **Markdown** or WYSIWYG. [Click here](http://letstalkbitcoin.com/markdown-formatting) to learn more about Markdown. \r\n\r\n####Please choose a category (which can be changed later), or your post may be invisible to and inaccessible by editorial staff.\r\n\r\n####When you finish your draft, if you want to submit your work to the front page, or if you\'d like another set of eyes before you publish to your blog, choose the status \"Ready for Review\" so the system will notify us of your submission.',1,1,'markdown'),(21,'Dashboard Blog Submissions','dashboard-blog-submissions','Note: Post formatting can be done via **Markdown** or WYSIWYG. [Click here](http://letstalkbitcoin.com/markdown-formatting) to view more about Markdown. \r\n\r\n####Please choose a category (which can be changed later), or your post may be invisible to and inaccessible by editorial staff. \r\n\r\n####When you finish your draft, if you\'d like to submit to the front page, or if you\'d like another set of eyes before you publish to your blog, choose the status \"Ready for Review\" so the system will notify us of your submission.',1,1,'markdown'),(23,'Dashboard Newsroom Content','dashboard-newsroom','<!-- explainer text for newsroom here -->',1,1,'markdown'),(24,'Top Ad','top-ad','',1,1,'wysiwyg'),(41,'Header Extra Links','header-extra-links','[<i class=\"fa fa-btc\"></i> Token Services](http://labs.ironcladtech.ca/ltb-dev/www/services)',0,1,'markdown'),(42,'Sidebar Subscribe Buttons','sidebar-subscribe-buttons','						<ul class=\"featured-menu\">\r\n							<li><a href=\"https://feeds.feedburner.com/TheDailyBitcoinShow\" title=\"Subscribe to the LTBN RSS Feed\" target=\"_blank\">Subscribe <i class=\"fa fa-rss\"></i></a></li>\r\n							<li><a href=\"/blog/category/ltb-network-shows\" title=\"Listen to the latest podcast episodes\">Episodes <i class=\"fa fa-volume-up\"></i></a></li>\r\n						</ul>',1,1,'raw'),(43,'Custom Sidebar Content','custom-sidebar-content','',1,1,'markdown'),(44,'Main Forum Description','main-forum-description','',1,1,'markdown'),(46,'Default Sidebar Ad','default-sidebar-ad','',1,1,'raw');
